import { JeecgListMixin } from "../../../mixins/JeecgListMixin2";
import { deleteAction, downFile, getAction, postAction } from '@/api/manage';
import JSelectUserByDepSingle from "../../../components/jeecgbiz/JSelectUserByDepSingle";
export default {
  name: "taskShiftModal",
  mixins: [JeecgListMixin],
  components: {
    JSelectUserByDepSingle: JSelectUserByDepSingle
  },
  data: function data() {
    return {
      title: '任务移交',
      visible: false,
      confirmLoading: false,
      task: '',
      userIds: [],
      url: {
        taskShift: '/wf/task/taskShift'
      }
    };
  },
  created: function created() {},
  methods: {
    show: function show() {// this.visible = true
      // this.$refs.single.show()
      // this.visible = false
    },
    confirm: function confirm() {
      var _this = this;

      if (this.userIds.length == 0) {
        this.$message.error('请选择' + this.title + '人');
        return;
      }

      getAction(this.url.taskShift + "?taskId=" + this.task.id + "&destUserId=" + this.userIds[0] + "&sourceUserId=" + this.task.assignee).then(function (res) {
        if (res.success) {
          _this.$message.success(res.message);

          _this.handleCancel();
        } else {
          _this.$message.error(res.message);
        }
      });
    },
    cancel: function cancel() {
      this.handleCancel();
    },
    handleCancel: function handleCancel() {
      this.$emit('close');
      this.visible = false;
      this.dataInit();
    },
    dataInit: function dataInit() {
      this.selectionRows = [];
      this.selectedRowKeys = [];
    },
    senUserId: function senUserId(ids) {
      this.userIds = ids;
      this.confirm();
    }
  }
};
